// core components/views for Admin layout
import SearchInsumo from './Views/SearchInsumo'

const dashboardRoutes = [
  {
    path: "/insumo/search",
    name: "DashClean",
    component: SearchInsumo,
    layout: "/orcamento"
  },
];

export default dashboardRoutes;
